  false,\n\t\"url\": null,\n\t\"notes\": \"Point coverage of 'Dams within the jurisdiction
  of the State of California' (Bulletin 17-93, California Department of Water Resources
  (DWR), Division of Safety of Dams, Sacramento). Jurisdictional Dams are defined
  as 'artificial barriers, together with appurtenant works, which are 25 feet or more
  in height or have an impounding capacity of 50 acre-feet or more. Any artificial
  barrier not in excess of 6 feet in height, regardless of storage capacity, or that
  has a storage capacity not in excess of 6 feet in height, regardless of storage
  capacity, or that has a storage capacity not in excess of 15 acre-feet, regardless
  of height, is not considered jurisdictional.' (DWR Bulletin 17-93).\",\n\t\"license_title\":
